import React from "react";
import "../styles/Card.css";

const Card = ({ name, age, company, phone, email, theme }) => {
  return (
    <div
      className={`container ${
        theme === "light" ? "light-theme" : "dark-theme"
      }`}
    >
      <img
        alt="profile_picture"
        src="https://avatars0.githubusercontent.com/u/68906240?s=460&v=4"
      />
      <span>{name}</span>
      <span>{age}</span>
      <span>{company}</span>
      <span>{phone}</span>
      <span>{email}</span>
      <span>{theme}</span>
    </div>
  );
};

export default Card;
